import React, {Component} from 'react';

class Home extends Component {
    state = {  }

    handleLogout = () => {
        const {update} = this.props;
        update();
        this.props.history.push("/login");       
    }

    render() { 
        return ( 
            <div>
                <h1>Welcome to Homepage </h1>
                <button type="button" onClick={this.handleLogout}>Logout</button>
            </div>
        )
    }
}
 
export default Home;
